import styled from 'styled-components';

export const NavContainer = styled.nav`
  display: flex;
  font-family: var(--font-family-subtitle);
  color: var(--font-color);
  align-items: center;
  justify-content: center;
  padding: 0;
  margin: 0;
  max-width: 1280px;
  justify-items: center;
  position: relative;
  top: 0;
  width: 100%;
  /* gap: 10rem; */
  max-height: 10rem;

  ul {
    display: flex;
    gap: 1rem;
    list-style-type: none;
  }

  .logo-container {
    display: flex;

    img {
      width: 100%;
      height: auto;
    }
  }
`;
